import React from 'react';
import { compose } from 'recompose';

import { Grid, Image, Icon } from 'semantic-ui-react'
import { withAuthorization, withEmailVerification } from '../Session';

import './index.scss';


const CategoryPage = () => (
	<div>
		<div className="ui buttons">
			<button className="ui red button" id="block">
				Math
			</button>
			<button className="ui blue button" id="block">
				Physics
			</button>
		</div>
		<br/>
		<div className="ui buttons" >
			<button className="ui green button" id="block">
				Chemistry
			</button>
			<button className="ui purple button" id="block">
				Biology
			</button>
		</div>
	</div>
)

export default CategoryPage;

// const condition = authUser => !!authUser;

